window.bookSummaryJSON = "<p>Everything changed the night our eyes met across the room. His green gaze upon me prickled my skin with uncustomary warmth while my peek beneath his cuff - of a riot of color on his wrist - sparked my insatiable curiosity. Tall and mysterious, Kader was a man whose secrets I longed to know. </p> <p>Little did I realize that the night we met was only the beginning - the beginning to the end of the existence I knew. </p> <p>What will happen as his assignment becomes our obsession? </p> <p>From <i>New York Times</i> best-selling author Aleatha Romig comes a brand-new dark romance bringing us back to the same dangerous underworld as <i>Secrets</i>. You do not need to read the Web of Sin trilogy to get caught in this new and intriguing saga, Tangled Web. </p> <p><i>Obsessed </i>is book two of the Tangled Web trilogy which began with <i>Twisted </i>and will conclude with <i>Bound</i>. </p> <p>Have you been Aleathaâ€™d?</p>"; 
